import React from "react";
import ReactDOM from "react-dom/client";

import { BrowserRouter as Router} from "react-router-dom";

import App from './App';
import './index.css';


ReactDOM.createRoot(
    <Router>
        <App />
    </Router>,
    document.getElementById('root')

);
